import {useState,useEffect} from 'react';
import axios from "axios";


export default function (){
    const [memberList, setMemberList] = useState([]);


    useEffect(()=>{
        axios.get("/members")
            .then(res =>{
                setMemberList(res.data);
            })

    },[])


    return(
        <div>MEMBER LIST
            {memberList}


        </div>

    )


}
